  }


  return (
    <AuthContext.Provider value={false}>
      <div className="App">
        <header className="App-header">
        </header>

        <Switch>
          <Route exact path='/'>
            <a href={LOGIN_URL}>Login</a>
          </Route>
          <Route path='/home'>
            <Home />
          </Route>
        </Switch>

      </div>
    </AuthContext.Provider>
  );
}

export default App;
